import React from 'react';
import './App.css';
import GlowingButton from './components/GlowingButton'; // Import the GlowingButton component
import TerminalLoader from './components/TerminalLoader'; // Import the TerminalLoader component

function App() {
  // Handle button click event
  const handleClick = () => {
    alert('Button clicked!');
  };

  return (
    <div className="App">
      <header className="App-header">
        <GlowingButton text="Coming Soon" onClick={handleClick} />
      </header>
      <main>
        <TerminalLoader />
      </main>
    </div>
  );
}

export default App;
